import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import AppTempSensor from './AppTempSensor';
import AppHumiditySensor from './AppHumiditySensor';
import AppTemperatureGrids from './AppTemperatureGrids';

export default function DataTabs() {
  const [value, setValue] = React.useState('1');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', typography: 'body1' }}>
      <TabContext value={value}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <TabList onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="Temperature" value="1" />
            <Tab label="Humidity" value="2" />
            <Tab label="Battery" value="3" />
            <Tab label="Tilt" value="4" />
            <Tab label="Gas" value="5" />
            <Tab label="Flame" value="6" />
            <Tab label="Smoke" value="7" />
            <Tab label="Photoresistor" value="8" />
          </TabList>
        </Box>
        <TabPanel value="1">
          <AppTempSensor />
          <AppTemperatureGrids padding="5,5" />
        </TabPanel>
        <TabPanel value="2">
          <AppHumiditySensor />
        </TabPanel>
        <TabPanel value="3">Item Three</TabPanel>
        <TabPanel value="4">Temperature</TabPanel>
        <TabPanel value="5">Humidity</TabPanel>
        <TabPanel value="6">Item Three</TabPanel>
        <TabPanel value="7">Temperature</TabPanel>
        <TabPanel value="8">Humidity</TabPanel>
      </TabContext>
    </Box>
  );
}
